  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Ozark Plateau National Wildlife Refuge for the
  next 15 years. This plan outlines the Refuge vision and purpose and describes how
  the Refuge will contribute to the overall mission of the Refuge System. The plan
  provides an introduction to the Refuge, an overview of the CCP process, a summary
  of Refuge resources, goals and objectives, alternatives, information about the management
  direction, current management programs, and strategies for implementation.\",\n\t\"license_title\":
